  \"Copper and Other Contaminants in King's Bay and Crystal River (Florida) Sediments:
  Implications for Impact on the West Indian Manatee\",\n\t\"tracking_summary\": {\n\t\t\"total\":
  16,\n\t\t\"recent\": 0\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T22:41:56.305850\",\n\t\"name\": \"copper-and-other-contaminants-in-kings-bay-and-crystal-river-florida-sediments-implication\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Contaminant concentrations were measured
  in 25 sediment samples collected from King's Bay, the headwaters of the Crystal
  River, Florida. Total organic carbon content ranged from 0.17 to 9.95% dry weight.
  No organochlorine pesticides, pesticide metabolites or polychlorinated biphenyls
  (PCBs) were detected at concentrations above the detection limit of 0.01 ppm (0.10
  ppm for total PCBs and toxaphene). Antimony, cadmium, silver and tin were not detected;
  however, arsenic, barium, chromium, iron, magnesium, manganese, selenium, strontium
  and vanadium were present at above-detection-limit concentrations at all locations
  sampled. Aluminum data were used to normalize all other metals concentration data.
  Arsenic, iron, and zinc concentrations at some sampling sites; and copper concentrations
  (range=<3.5-237 ppm dry weight) at all sample locations; appeared to be elevated
  due to anthropogenic influence. If transported through the food chain, copper concentrations
  at the most contaminated sites may be sufficient to adversely impact the West Indian
  manatee (Trichecus manatus).\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
